from warnings import warn
import numpy as np

from topoptlab.fem import get_integrpoints
from topoptlab.elements.trilinear_hexahedron import bmatrix

def _lk_linear_elast_3d(xe,c,
                        quadr_method="gauss-legendre",
                        nquad=2):
    """
    Create element stiffness matrix for 2D isotropic linear elasticity with 
    bilinear quadrilateral Lagrangian elements in plane stress.
    
    Parameters
    ----------
    xe : np.ndarray, shape (nels,8,2)
        coordinates of element nodes. Please look at the 
        definition/function of the shape function, then the node ordering is 
        clear.
    c : np.ndarray, shape (nels,9,9) or 
        stiffness tensor.
    quadr_method: str or callable
        name of quadrature method or function/callable that returns coordinates of 
        quadrature points and weights. Check function get_integrpoints for 
        available options. 
    nquad : int
        number of quadrature points
        
    Returns
    -------
    Ke : np.ndarray, shape (nels,24,24)
        element stiffness matrix.
        
    """
    #
    if len(xe.shape) == 2:
        xe = xe[None,:,:]
    nel = xe.shape[0]
    #
    if len(c.shape) == 2:
        c = c[None,:,:]
    #
    x,w=get_integrpoints(ndim=3,nq=nquad,method=quadr_method)
    nq =w.shape[0]
    #
    xi,eta,zeta = [_x[:,0] for _x in np.split(x, 3,axis=1)]
    #
    nel = xe.shape[0]
    nq =w.shape[0]
    # 
    B,detJ = bmatrix(xi=xi, eta=eta, zeta=zeta, xe=xe, 
                     all_elems=True, 
                     return_detJ=True)
    detJ = detJ.reshape(nel,nq)
    B = B.reshape(nel, nq,  B.shape[-2], B.shape[-1])
    #
    integral = B.transpose([0,1,3,2])@c[:,None,:,:]@B
    # multiply by determinant and quadrature
    return (w[None,:,None,None]*integral*detJ[:,:,None,None]).sum(axis=1)

def lk_linear_elast_3d(E=1,nu=0.3):
    """
    Create element stiffness matrix for 3D isotropic linear elasticity with 
    hexahedron elements. Taken and adjusted from the new generation 99 line 
    code.
    
    Parameters
    ----------
    E : float
        Young's modulus.
    nu : float
        Poisson' ratio.
    
    Returns
    -------
    Ke : np.ndarray, shape (24,24)
        element stiffness matrix.
        
    """
    # prefactor
    coeff = E / ((1 + nu) * (2 * nu - 1) * 144)
    # 
    Ke1 = np.array( [-32,-6,-6,8,6,6,10,6,3,-4,-6,-3,
                     -4,-3,-6,10,3,6,8,3,3,4,-3,-3, 
                     -32,-6,-6,-4,-3,6,10,3,6,8,6,-3,
                     -4,-6,-3,4,-3,3,8,3,3,10,6,-32,
                     -6,-3,-4,-3,-3,4,-3,-6,-4,6,6,8,
                     6,3,10,3,3,8,3,6,10,-32,6,6,
                     -4,6,3,10,-6,-3,10,-3,-6,-4,3,6,
                     4,3,3,8,-3,-3,-32,-6,-6,8,6,-6,
                     10,3,3,4,-3,3,-4,-6,-3,10,6,-3,
                     8,3,-32,3,-6,-4,3,-3,4,-6,3,10,
                     -6,6,8,-3,6,10,-3,3,8,-32,-6,6,
                     8,6,-6,8,3,-3,4,-3,3,-4,-3,6,
                     10,3,-6,-32,6,-6,-4,3,3,8,-3,3,
                     10,-6,-3,-4,6,-3,4,3,-32,6,3,-4,
                     -3,-3,8,-3,-6,10,-6,-6,8,-6,-3,10,
                     -32,6,-6,4,3,-3,8,-3,3,10,-3,6,
                     -4,3,-6,-32,6,-3,10,-6,-3,8,-3,3,
                     4,3,3,-4,6,-32,3,-6,10,3,-3,8,
                     6,-3,10,6,-6,8,-32,-6,6,8,6,-6,
                     10,6,-3,-4,-6,3,-32,6,-6,-4,3,6,
                     10,-3,6,8,-6,-32,6,3,-4,3,3,4,
                     3,6,-4,-32,6,-6,-4,6,-3,10,-6,3,
                     -32,6,-6,8,-6,-6,10,-3,-32,-3,6,-4,
                     -3,3,4,-32,-6,-6,8,6,6,-32,-6,-6,
                     -4,-3,-32,-6,-3,-4,-32,6,6,-32,-6,-32])
    Ke2 = np.array([48,0,0,0,-24,-24,-12,0,-12,0,24,0,
                    0,0,24,-12,-12,0,-12,0,0,-12,12,12,
                    48,0,24,0,0,0,-12,-12,-24,0,-24,
                    0,0,24,12,-12,12,0,-12,0,-12,-12,0,
                    48,24,0,0,12,12,-12,0,24,0,-24,-24,
                    0,0,-12,-12,0,0,-12,-12,0,-12,48,0,
                    0,0,-24,0,-12,0,12,-12,12,0,0,0,-24,
                    -12,-12,-12,-12,0,0,48,0,24,0,-24,0,
                    -12,-12,-12,-12,12,0,0,24,12,-12,0,0,
                    -12,0,48,0,24,0,-12,12,-12,0,-12,-12,
                    24,-24,0,12,0,-12,0,0,-12,48,0,0,
                    0,-24,24,-12,0,0,-12,12,-12,0,0,-24,
                    -12,-12,0,48,0,24,0,0,0,-12,0,-12,
                    -12,0,0,0,-24,12,-12,-12,48,-24,0,0,
                    0,0,-12,12,0,-12,24,24,0,0,12,-12,
                    48,0,0,-12,-12,12,-12,0,0,-12,12,0,
                    0,0,24,48,0,12,-12,0,0,-12,0,-12,
                    -12,-12,0,0,-24,48,-12,0,-12,0,0,-12,
                    0,12,-12,-24,24,0,48,0,0,0,-24,24,
                    -12,0,12,0,24,0,48,0,24,0,0,0,
                    -12,12,-24,0,24,48,-24,0,0,-12,-12,-12,
                    0,-24,0,48,0,0,0,-24,0,-12,0,-12,
                    48,0,24,0,24,0,-12,12,48,0,-24,0,
                    12,-12,-12,48,0,0,0,-24,-24,48,0,24,
                    0,0,48,24,0,0,48,0,0,48,0,48] )
    #
    Ke = np.zeros((24,24))
    Ke[np.triu_indices(24)] = coeff * (Ke1 + nu * Ke2)
    Ke = Ke + Ke.T - np.diag(np.diag(Ke))
    return Ke

